import React from 'react';
import Nav from "../components/main/Nav";
import LoginBox from "../components/main/LoginBox";

const Login = () => {
    const styles = {
        layout: {
            display: 'flex',
            height: '100%',
            overflow: 'hidden',
            alignItems: 'center',
            alignContent: 'center',
            justifyContent: 'center'
        }
    }

    return (
        <div>
            <Nav />
            <div style={styles.layout}>
                <LoginBox />
            </div>
        </div>
    );
};

export default Login;
